import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // To make the sort filter visible, we first need to perform a search
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.locator('#searchInput').fill('electronics');
    await page.locator('button.search-btn').first().click();

    // Wait for search results and sort controls to appear
    await page.waitForSelector('.sort-filter-controls', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_results.png'));

    // Locate the sort dropdown and select the "Price: High to Low" option
    const sortSelect = await page.locator('#sortSelect');
    await sortSelect.selectOption('price-high');

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_price_sorted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_price_sorted.png'));

    // Extract the selected value to verify the action
    const selectedSortValue = await sortSelect.inputValue();

    return {
      success: true,
      action: "Applied 'Price: High to Low' sort filter after searching for a product.",
      extractedData: {
        selectedSortOption: selectedSortValue,
        expectedSortOption: 'price-high'
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price sort filter",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
